import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">Weather App</header>
      <div className="row">
        <div className="col">#1mmmm</div>
        <div className="col">#2</div>
        <div className="col">#3</div>
      </div>
    </div>
  );
}

export default App;
